import photoPro from "../../images/photoPro.jpg";

function Informations() {
	return (
		<div className='autour'>
			<div className='photo'>
				<img src={photoPro} width='300px' height='400px' alt='' />
			</div>
		</div>
	);
}

export default Informations;
